import React, { useState, useEffect } from 'react';
import axios from 'axios';

interface TACOSignal {
  id: number;
  signal_type: string;
  confidence: number;
  statement: {
    original: string;
    korean: string;
    keywords: string[];
    posted_at: string;
  };
  affected_etfs: any[];
  created_at: string;
}

interface TrumpStatement {
  id: number;
  original_text: string;
  korean_translation: string;
  keywords: string[];
  taco_probability: number;
  time_ago: string;
}

interface ETFPrice {
  symbol: string;
  price: number;
  change_percent: number;
  volume: number;
  description?: string;
}

interface PerformanceData {
  total_return_30d: number;
  win_rate: number;
  total_profit: number;
  total_signals: number;
  successful_signals: number;
  average_holding_days: number;
}

function App() {
  const [signals, setSignals] = useState<TACOSignal[]>([]);
  const [statements, setStatements] = useState<TrumpStatement[]>([]);
  const [etfPrices, setETFPrices] = useState<ETFPrice[]>([]);
  const [performance, setPerformance] = useState<PerformanceData | null>(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState<string | null>(null);
  const [lastUpdate, setLastUpdate] = useState<Date>(new Date());

  useEffect(() => {
    fetchData();
    
    // 30Ï¥àÎßàÎã§ Îç∞Ïù¥ÌÑ∞ ÏÉàÎ°úÍ≥†Ïπ®
    const interval = setInterval(() => {
      console.log('üîÑ ÏûêÎèô Îç∞Ïù¥ÌÑ∞ ÏÉàÎ°úÍ≥†Ïπ®...');
      fetchData();
    }, 30000);
    
    return () => clearInterval(interval);
  }, []);

  const fetchData = async () => {
    try {
      setError(null);
      // Í∞úÎ∞ú ÌôòÍ≤ΩÏóêÏÑúÎäî Î∞±ÏóîÎìú ÏÑúÎ≤Ñ ÏßÅÏ†ë Ìò∏Ï∂ú
      const baseURL = 'http://localhost:8000';
      
      console.log('üåÆ Î∞±ÏóîÎìú ÏÑúÎ≤Ñ Ïó∞Í≤∞ ÏãúÎèÑ...', baseURL);
      console.log('ÌòÑÏû¨ ÏãúÍ∞Ñ:', new Date().toLocaleTimeString());
      
      // Í∞Å APIÎ•º Í∞úÎ≥ÑÏ†ÅÏúºÎ°ú Ìò∏Ï∂úÌïòÏó¨ Ïñ¥Îäê Í≤ÉÏù¥ Ïã§Ìå®ÌïòÎäîÏßÄ ÌôïÏù∏
      console.log('1Ô∏è‚É£ Ïã†Ìò∏ Îç∞Ïù¥ÌÑ∞ ÏöîÏ≤≠ Ï§ë...');
      const signalsRes = await axios.get(`${baseURL}/api/latest-signals`);
      console.log('‚úÖ Ïã†Ìò∏ Îç∞Ïù¥ÌÑ∞ ÏÑ±Í≥µ:', signalsRes.data);
      
      console.log('2Ô∏è‚É£ Î∞úÏñ∏ Îç∞Ïù¥ÌÑ∞ ÏöîÏ≤≠ Ï§ë...');
      const statementsRes = await axios.get(`${baseURL}/api/trump-feed`);
      console.log('‚úÖ Î∞úÏñ∏ Îç∞Ïù¥ÌÑ∞ ÏÑ±Í≥µ:', statementsRes.data);
      
      console.log('3Ô∏è‚É£ ETF Îç∞Ïù¥ÌÑ∞ ÏöîÏ≤≠ Ï§ë...');
      const pricesRes = await axios.get(`${baseURL}/api/etf-prices`);
      console.log('‚úÖ ETF Îç∞Ïù¥ÌÑ∞ ÏÑ±Í≥µ:', pricesRes.data);
      
      console.log('4Ô∏è‚É£ ÏÑ±Í≥º Îç∞Ïù¥ÌÑ∞ ÏöîÏ≤≠ Ï§ë...');
      const performanceRes = await axios.get(`${baseURL}/api/performance`);
      console.log('‚úÖ ÏÑ±Í≥º Îç∞Ïù¥ÌÑ∞ ÏÑ±Í≥µ:', performanceRes.data);

      console.log('üéâ Î™®Îì† Îç∞Ïù¥ÌÑ∞ Î°úÎìú ÏôÑÎ£å!');
      console.log('Ïã†Ìò∏ Ïàò:', signalsRes.data.signals?.length || 0);
      console.log('Î∞úÏñ∏ Ïàò:', statementsRes.data.statements?.length || 0);
      console.log('ETF Ïàò:', pricesRes.data.etf_prices?.length || 0);

      setSignals(signalsRes.data.signals || []);
      setStatements(statementsRes.data.statements || []);
      setETFPrices(pricesRes.data.etf_prices || []);
      setPerformance(performanceRes.data);
      setLastUpdate(new Date());
      setLoading(false);
      
      console.log('üìä State ÏóÖÎç∞Ïù¥Ìä∏ ÏôÑÎ£å');
    } catch (error: any) {
      console.error('‚ùå Îç∞Ïù¥ÌÑ∞ Î°úÎìú Ïò§Î•ò:', error);
      console.error('ÏóêÎü¨ ÌÉÄÏûÖ:', typeof error);
      console.error('ÏóêÎü¨ Ïù¥Î¶Ñ:', error.name);
      console.error('ÏóêÎü¨ Î©îÏãúÏßÄ:', error.message);
      console.error('ÏóêÎü¨ Ïä§ÌÉù:', error.stack);
      console.error('ÏùëÎãµ ÏÉÅÌÉú:', error.response?.status);
      console.error('ÏùëÎãµ Îç∞Ïù¥ÌÑ∞:', error.response?.data);
      console.error('ÏóêÎü¨ ÏΩîÎìú:', error.code);
      
      const errorMessage = error.response?.status === 404 
        ? 'Î∞±ÏóîÎìú APIÎ•º Ï∞æÏùÑ Ïàò ÏóÜÏäµÎãàÎã§. ÏÑúÎ≤ÑÍ∞Ä Ïã§Ìñâ Ï§ëÏù∏ÏßÄ ÌôïÏù∏ÌïòÏÑ∏Ïöî.'
        : error.code === 'ECONNREFUSED' || error.message.includes('ECONNREFUSED')
        ? 'Î∞±ÏóîÎìú ÏÑúÎ≤Ñ Ïó∞Í≤∞ Ïã§Ìå®. localhost:8000ÏóêÏÑú ÏÑúÎ≤ÑÎ•º Ïã§ÌñâÌïòÏÑ∏Ïöî.'
        : error.message.includes('CORS')
        ? 'CORS Ïò§Î•òÏûÖÎãàÎã§. Î∞±ÏóîÎìú ÏÑúÎ≤ÑÎ•º Îã§Ïãú ÏãúÏûëÌï¥Î≥¥ÏÑ∏Ïöî.'
        : `Îç∞Ïù¥ÌÑ∞Î•º Î∂àÎü¨Ïò§Îäî Ï§ë Ïò§Î•òÍ∞Ä Î∞úÏÉùÌñàÏäµÎãàÎã§: ${error.message}`;
      
      setError(errorMessage);
      setLoading(false);
      
      // Ïò§Î•ò Î∞úÏÉù Ïãú Îπà Î∞∞Ïó¥Î°ú ÏÑ§Ï†ï
      setSignals([]);
      setStatements([]);
      setETFPrices([]);
    }
  };

  if (loading) {
    return (
      <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh', backgroundColor: '#0A0A0A', color: '#fff' }}>
        <div style={{ textAlign: 'center' }}>
          <div style={{ fontSize: '2rem', marginBottom: '10px' }}>üåÆ</div>
          <div>TACO Îç∞Ïù¥ÌÑ∞ Î°úÎî© Ï§ë...</div>
          <div style={{ fontSize: '0.8rem', color: '#98989D', marginTop: '10px' }}>
            Î∞±ÏóîÎìú ÏÑúÎ≤Ñ Ïó∞Í≤∞ Ï§ë...
          </div>
        </div>
      </div>
    );
  }

  if (error) {
    return (
      <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh', backgroundColor: '#0A0A0A', color: '#fff' }}>
        <div style={{ textAlign: 'center', maxWidth: '500px', padding: '20px' }}>
          <div style={{ fontSize: '2rem', marginBottom: '20px' }}>‚ùå</div>
          <div style={{ fontSize: '1.2rem', marginBottom: '15px', color: '#FF3B30' }}>
            Ïó∞Í≤∞ Ïò§Î•ò
          </div>
          <div style={{ marginBottom: '20px', color: '#98989D' }}>
            {error}
          </div>
          <div style={{ fontSize: '0.9rem', color: '#636366', lineHeight: '1.5' }}>
            <div>Ìï¥Í≤∞ Î∞©Î≤ï:</div>
            <div>1. Î∞±ÏóîÎìú ÏÑúÎ≤Ñ Ïã§Ìñâ: <code style={{ background: '#1C1C1E', padding: '2px 6px', borderRadius: '4px' }}>cd backend && python -m app.main</code></div>
            <div>2. ÏÑúÎ≤Ñ Ï£ºÏÜå ÌôïÏù∏: <code style={{ background: '#1C1C1E', padding: '2px 6px', borderRadius: '4px' }}>http://localhost:8000</code></div>
          </div>
          <button 
            onClick={fetchData}
            style={{
              marginTop: '20px',
              padding: '10px 20px',
              background: '#007AFF',
              color: 'white',
              border: 'none',
              borderRadius: '8px',
              cursor: 'pointer'
            }}
          >
            Îã§Ïãú ÏãúÎèÑ
          </button>
        </div>
      </div>
    );
  }

  return (
    <div style={{ padding: '20px', backgroundColor: '#0A0A0A', color: '#fff', minHeight: '100vh' }}>
      <h1 style={{ textAlign: 'center', marginBottom: '30px' }}>
        üåÆ TACO(Trump Always Chickens Out) Trading
      </h1>
      


      {/* ÏÑ±Í≥º ÏöîÏïΩ */}
      <div style={{ display: 'grid', gridTemplateColumns: 'repeat(4, 1fr)', gap: '20px', marginBottom: '30px' }}>
        <div style={{ background: '#1C1C1E', padding: '20px', borderRadius: '12px', textAlign: 'center' }}>
          <div style={{ fontSize: '2rem', fontWeight: 'bold', color: '#00D084' }}>
            {performance ? `+${performance.total_return_30d.toFixed(1)}%` : '+127%'}
          </div>
          <div style={{ color: '#98989D' }}>30Ïùº TACO ÏàòÏùµÎ•†</div>
        </div>
        <div style={{ background: '#1C1C1E', padding: '20px', borderRadius: '12px', textAlign: 'center' }}>
          <div style={{ fontSize: '2rem', fontWeight: 'bold', color: '#00D084' }}>
            {performance ? `${performance.win_rate.toFixed(0)}%` : '78%'}
          </div>
          <div style={{ color: '#98989D' }}>TACO ÏÑ±Í≥µÎ•†</div>
        </div>
        <div style={{ background: '#1C1C1E', padding: '20px', borderRadius: '12px', textAlign: 'center' }}>
          <div style={{ fontSize: '2rem', fontWeight: 'bold', color: '#00D084' }}>
            {performance ? `+$${performance.total_profit.toLocaleString()}` : '+$12,450'}
          </div>
          <div style={{ color: '#98989D' }}>Ï¥ù TACO ÏàòÏùµ</div>
        </div>
        <div style={{ background: '#1C1C1E', padding: '20px', borderRadius: '12px', textAlign: 'center' }}>
          <div style={{ fontSize: '2rem', fontWeight: 'bold', color: '#FF9500' }}>
            {performance ? performance.total_signals : signals.length}
          </div>
          <div style={{ color: '#98989D' }}>Ïã§ÌñâÎêú TACO Ïã†Ìò∏</div>
        </div>
      </div>

      <div style={{ display: 'grid', gridTemplateColumns: 'repeat(2, 1fr)', gap: '20px' }}>
        {/* Ìä∏ÎüºÌîÑ ÌîºÎìú */}
        <div style={{ background: '#1C1C1E', padding: '20px', borderRadius: '12px' }}>
          <h3>üéôÔ∏è Trump Intelligence Feed</h3>
          {statements.map(stmt => (
            <div key={stmt.id} style={{
              background: '#0A0A0A',
              padding: '15px',
              margin: '10px 0',
              borderRadius: '8px',
              border: '1px solid #38383A'
            }}>
              {/* ÌïúÍµ≠Ïñ¥ Î≤àÏó≠ */}
              <div style={{ marginBottom: '6px' }}>{stmt.korean_translation}</div>
              {/* ÏõêÎ¨∏ ÏòÅÏñ¥ */}
              <div style={{ 
                marginBottom: '10px', 
                color: '#98989D', 
                fontSize: '0.85rem', 
                fontStyle: 'italic' 
              }}>
                "{stmt.original_text}"
              </div>
              <div style={{ 
                background: 'rgba(255, 255, 255, 0.05)',
                padding: '10px',
                borderRadius: '6px',
                fontSize: '0.8rem'
              }}>
                <div>üîç ÌÇ§ÏõåÎìú: {stmt.keywords.join(', ')}</div>
                <div>üåÆ TACO ÌôïÎ•†: {stmt.taco_probability}%</div>
              </div>
              <div style={{ 
                display: 'flex',
                justifyContent: 'space-between',
                alignItems: 'center',
                marginTop: '10px',
                fontSize: '0.8rem',
                color: '#636366'
              }}>
                <span>{stmt.time_ago} ‚Ä¢ Truth Social</span>
                <div>
                  <span style={{ 
                    background: '#007AFF',
                    color: 'white',
                    padding: '2px 6px',
                    borderRadius: '6px',
                    marginRight: '5px'
                  }}>ü§ñ AI Î≤àÏó≠</span>
                  <span style={{ 
                    background: '#FF3B30',
                    color: 'white',
                    padding: '2px 6px',
                    borderRadius: '6px'
                  }}>ÎÜíÏùÄ ÏòÅÌñ•</span>
                </div>
              </div>
            </div>
          ))}
        </div>

        {/* ETF Í∞ÄÍ≤© */}
        <div style={{ background: '#1C1C1E', padding: '20px', borderRadius: '12px' }}>
          <h3>üìä Market Pulse</h3>
          {etfPrices.map(etf => (
            <div key={etf.symbol} style={{
              display: 'flex',
              flexDirection: 'column',
              padding: '10px',
              margin: '5px 0',
              background: '#0A0A0A',
              borderRadius: '6px'
            }}>
              <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
                <span style={{ fontWeight: 'bold', fontFamily: 'monospace' }}>{etf.symbol}</span>
                <span style={{ 
                  color: etf.change_percent >= 0 ? '#00D084' : '#FF3B30',
                  fontWeight: 'bold',
                  fontFamily: 'monospace'
                }}>
                  {etf.change_percent >= 0 ? '+' : ''}{etf.change_percent.toFixed(1)}%
                </span>
              </div>
              {etf.description && (
                <div style={{ color: '#98989D', fontSize: '0.85rem', marginTop: '4px' }}>
                  {etf.description}
                </div>
              )}
            </div>
          ))}
        </div>
      </div>

      <div style={{ textAlign: 'center', marginTop: '30px', color: '#636366' }}>
        <div style={{ marginBottom: '10px' }}>
          üåÆ TACO Trading - 
          <span style={{ color: '#00D084', marginLeft: '5px' }}>
            ‚úÖ API Ïó∞Í≤∞ ÏÑ±Í≥µ!
          </span>
        </div>
        <div style={{ fontSize: '0.8rem' }}>
          Ïã†Ìò∏: {signals.length}Í∞ú | Î∞úÏñ∏: {statements.length}Í∞ú | ETF: {etfPrices.length}Í∞ú
        </div>
        <div style={{ fontSize: '0.7rem', marginTop: '5px' }}>
          ÎßàÏßÄÎßâ ÏóÖÎç∞Ïù¥Ìä∏: {lastUpdate.toLocaleTimeString('ko-KR')}
          <span style={{ color: '#00D084', marginLeft: '10px' }}>üîÑ 30Ï¥àÎßàÎã§ ÏûêÎèô ÏÉàÎ°úÍ≥†Ïπ®</span>
        </div>
      </div>
    </div>
  );
}

export default App;
